try {
    org.eclipse.jgit.transport.BasePackConnection.readAdvertisedRefsImpl();
} catch (org.eclipse.jgit.errors.TransportException err) {
    org.eclipse.jgit.transport.BasePackConnection.close();
    throw org.eclipse.jgit.errors.TransportException;
} catch (java.io.IOException err) {
    org.eclipse.jgit.transport.BasePackConnection.close();
    throw new org.eclipse.jgit.errors.TransportException(java.io.IOException.getMessage() , java.io.IOException);
} catch (java.lang.RuntimeException err) {
    org.eclipse.jgit.transport.BasePackConnection.close();
    throw new org.eclipse.jgit.errors.TransportException(java.lang.RuntimeException.getMessage() , java.lang.RuntimeException);
}
